// Dashboard.js
import React, { useState, useEffect } from 'react';
import GroupList from './GroupList'; // Left sidebar with group names
import KeywordChart from './KeywordChart'; // Chart for keyword usage
import axios from 'axios';

const Dashboard = () => {
  const [groups, setGroups] = useState([]);
  const [selectedGroup, setSelectedGroup] = useState(null);
  const [keywords, setKeywords] = useState([]);
  const [groupMembers, setGroupMembers] = useState([]);
  const [user, setUser] = useState({ name: 'User' }); // Placeholder for user data

  useEffect(() => {
    // Fetch group list from the server when component mounts
    const fetchGroups = async () => {
      const response = await axios.get('/api/groups'); // Adjust API endpoint
      setGroups(response.data);
    };
    fetchGroups();
  }, []);

  const handleGroupSelect = (groupId) => {
    setSelectedGroup(groupId);
    // Fetch keywords and group members for the selected group
    fetchGroupData(groupId);
  };

  const fetchGroupData = async (groupId) => {
    const keywordResponse = await axios.get(`/api/groups/${groupId}/keywords`);
    const membersResponse = await axios.get(`/api/groups/${groupId}/members`);
    setKeywords(keywordResponse.data);
    setGroupMembers(membersResponse.data);
  };

  const handleInviteBot = async () => {
    // Logic for inviting bot
  };

  const handleRemoveBot = async () => {
    // Logic for removing bot
  };

  const handleAddKeyword = async (newKeyword) => {
    // Logic for adding keyword
  };

  const handleRemoveKeyword = async (keyword) => {
    // Logic for removing keyword
  };

  return (
    <div className="flex h-screen">
      {/* Left sidebar */}
      <div className="w-1/5 bg-gray-800 text-white">
        <h2 className="text-xl p-4">Your Groups</h2>
        <GroupList groups={groups} onSelectGroup={handleGroupSelect} />
      </div>

      {/* Main content */}
      <div className="flex-1 p-6 bg-gray-100">
        {/* Top navigation bar */}
        <div className="flex justify-between items-center mb-6">
          <button className="bg-red-500 text-white px-4 py-2 rounded-lg" onClick={() => alert('Logging out...')}>
            Logout
          </button>
          <h2 className="text-lg font-semibold">Welcome, {user.name}</h2>
        </div>

        {/* Group management */}
        <div className="flex justify-between items-center mb-6">
          <h2 className="text-2xl font-bold">{selectedGroup ? `Managing: ${selectedGroup.name}` : 'Select a Group'}</h2>
          <div>
            <button className="bg-blue-500 text-white px-4 py-2 rounded-lg mr-2" onClick={handleInviteBot}>Invite Bot</button>
            <button className="bg-red-500 text-white px-4 py-2 rounded-lg" onClick={handleRemoveBot}>Remove Bot</button>
          </div>
        </div>

        {/* Keywords management */}
        <div className="mb-6">
          <h3 className="text-xl font-semibold">Keywords</h3>
          <ul>
            {keywords.map((keyword, index) => (
              <li key={index} className="flex justify-between items-center">
                {keyword}
                <button className="text-red-500" onClick={() => handleRemoveKeyword(keyword)}>Remove</button>
              </li>
            ))}
          </ul>
          <button className="mt-4 bg-green-500 text-white px-4 py-2 rounded-lg" onClick={() => handleAddKeyword(prompt('Enter new keyword'))}>
            Add Keyword
          </button>
        </div>

        {/* Group members list */}
        <div className="mb-6">
          <h3 className="text-xl font-semibold">Group Members</h3>
          <ul>
            {groupMembers.map((member, index) => (
              <li key={index} className="flex justify-between items-center">
                {member.name} - {member.keywordUsage} keywords
              </li>
            ))}
          </ul>
        </div>

        {/* Alert system */}
        <div className="mb-6">
          <button className="bg-yellow-500 text-white px-4 py-2 rounded-lg" onClick={() => alert('Alert system triggered!')}>
            Alert System
          </button>
        </div>

        {/* Keyword usage chart */}
        {selectedGroup && <KeywordChart groupId={selectedGroup.id} />}
      </div>
    </div>
  );
};

export default Dashboard;
